‚Å£
4 6-ounce salmon fillets pin bones removed ‚Å£
6 tablespoons pesto( I made this with 1c of fresh basil, 1 clove garlic, 1Tbs pine nuts, 1/4c olive oil, 1/4c permesean cheese) ‚Å£
1/3 cup fresh breadcrumbs‚Å£
1/3 cup freshly grated parmesan cheese grate with a microplane grater if possible.‚Å£
Instructions‚Å£
Preheat the oven to 325¬∞. Place a piece of tin foil on a rimmed baking sheet. Lay the salmon fillets on the baking sheet, not touching. Spoon 1 1/2 tablespoons of pesto over each fillet and spread it with the back of a spoon or knife so that it's lightly coated with pesto.‚Å£
In a small bowl, combine the breadcrumbs and parmesan cheese until evenly distributed.  Top each of the salmon fillets with a coating of the breadcrumb mixture.‚Å£
Cook the salmon for 12-15 minutes for medium.  To get the crust a golden brown, turn the oven to broil and heat for 45 seconds to 1 1/2 minutes with the salmon about 5 inches away from the heating element.  Keep an eye on it so it doesn't burn.‚Å£
Serve immediately.‚Å£
